import { initializeApp } from "firebase/app";
import { getAnalytics } from "firebase/analytics";
import { getStorage } from "firebase/storage";

// Your web app's Firebase configuration
const firebaseConfig = {
  apiKey: "AIzaSyB8uv7nLGzhHWb41YAj6kAYcYPzM0Nlihc",
  authDomain: "monportfolio-8dd08.firebaseapp.com",
  databaseURL: "https://monportfolio-8dd08-default-rtdb.europe-west1.firebasedatabase.app",
  projectId: "monportfolio-8dd08",
  storageBucket: "monportfolio-8dd08.appspot.com",
  messagingSenderId: "695750836627",
  appId: "1:695750836627:web:36bb56d9ade069cf3e2866",
  measurementId: "G-BRYCRYBJ4F"
};

// Initialize Firebase
const app = initializeApp(firebaseConfig);
const analytics = getAnalytics(app);
const storage = getStorage(app);

export { storage, app, analytics };
